import "./Movie.css";
import data from "../data";



const Movie = () => {
    return (
        <div>
            {
                data.map((oneMovie) => {
                const {title, age, img, tags, description} = oneMovie;
                    
                return <div>
                    <img src={img} alt={title} />
                    <h2>{title}</h2>
                    <p>{ age}</p>
                    <p>{tags}</p>
                    <p>{description} </p>
                </div>
            })}
        </div>
    )
}

export default Movie;
